import React from 'react'
import styled from 'styled-components';
const RollDice = () => {
  return (
    DiceContainer
  )
}

export default RollDice;

const DiceContainer = styled.div`
  margin-top: 48px;
  display: flex;
  flex-direction: column;
  align-items: center;

  .dice {
    cursor: pointer;
  }

  p {
    font-size: 24px;
  }
`;
